import  ReactDOM  from "react";
import './Header.css';
import PostList from "./Post-List";




const Header = () => {

    return (
        <header>
            <h1>Stranger's Things</h1>
                <div className="navbar">
                    <h3>Home</h3>
                    <h3>Posts</h3>
                    <h3>Login</h3>
                    <PostList />
                </div>

        </header>
)}

export default Header;
